import React from 'react';
import './App.css';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      response: "",
      clicked: true
    }
    this.handleClick = this.handleClick.bind(this);
  }

  componentDidMount() {
    fetch(`http://localhost:5000`, {
      method: 'GET'
    })
    .then(res => res.json())
    .then(resJSON => {
      this.setState({
        response: resJSON
      })
    })
  }

  handleClick() {
    this.setState({
      clicked: !this.state.clicked
    })
  }

  handleReload() {
    window.location.reload(false);
  }

  render() {
    return (
      <div>
        <div className='landing'>
          <h1>reactdog</h1>
          <p>{this.state.response.message}</p>
          <button onClick={this.handleClick}>Click me</button>
          {this.state.clicked === true ? <p>Click that button</p> : <p>Button was clicked</p>}
        </div>
      </div>
    )
  }
}
